css:
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
atom-text-editor::shadow .wrap-guide {
  background-color: rgba(0, 0, 0, 0.1);
}
atom-text-editor::shadow .indent-guide {
  color: rgba(255, 255, 255, 0.1);
}
atom-text-editor,
:host {
  background-color: #313437;
  color: #a0a0a0;
}
atom-text-editor .line-numbers .tile,
:host .line-numbers .tile {
  width: 90%;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(0, 0, 0, 0.1);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(255, 255, 255, 0.1);
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(0, 0, 0, 0.1);
}
atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background-color: rgba(0, 0, 0, 0.2);
}
atom-text-editor .cursor,
:host .cursor {
  border-left-width: 2px;
  border-left-color: #00a8c6;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #313437;
  color: #79afa9;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: rgba(0, 0, 0, 0.2);
  color: #f8f8f0;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #f8f8f0;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #cccccc;
}
atom-text-editor .invisible,
:host .invisible {
  color: #a0a0a0;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: rgba(0, 168, 198, 0.15);
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #bfbfbf;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #e6e6e6;
}
.comment {
  color: #666666;
}
.constant {
  color: #e6db74;
}
.constant.character.escape {
  color: #79afa9;
}
.constant.character.escape.python {
  color: #edba00;
}
.constant.other.color {
  color: #79afa9;
}
.constant.other.symbol {
  color: #8fbe00;
}
.css.class {
  color: #aa6699;
}
.css.pseudo-element {
  color: #a6e22e;
}
.entity.name.function {
  color: #f8f8f0;
}
.entity.name.type,
.entity.name.class,
.entity.name.type.class {
  color: #f8f8f0;
}
.entity.name.section {
  color: #cccc99;
}
.entity.name.tag {
  color: #738c73;
}
.entity.id {
  color: #00a8c6;
}
.entity.inherited-class {
  color: #f8f8f0;
}
.html.punctuation.definition.tag {
  color: #738c73;
}
.invalid.illegal {
  background-color: #da2000;
  color: #313437;
}
.keyword {
  color: #cccc99;
}
.keyword.control {
  color: #cccc99;
}
.keyword.operator {
  color: #a0a0a0;
}
.keyword.operator.python {
  color: #738c73;
}
.keyword.other.special-method {
  color: #e6db74;
}
.keyword.other.unit {
  color: #e6db74;
}
.keyword.control.exception {
  color: #cc0033;
}
.markup.bold {
  color: #ffcc00;
  font-weight: bold;
}
.markup.changed {
  color: #967efb;
}
.markup.deleted {
  color: #da2000;
}
.markup.italic {
  color: #aa6699;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #00a8c6;
}
.markup.inserted {
  color: #8fbe00;
}
.markup.list {
  color: #da2000;
}
.markup.quote {
  color: #ffcc00;
}
.markup.raw.inline {
  color: #8fbe00;
}
.meta.class {
  color: #f8f8f0;
}
.meta.link {
  color: #cc0033;
}
.meta.require {
  color: #a6e22e;
}
.meta.selector {
  color: #aa6699;
}
.meta.separator {
  background-color: #808080;
  color: #a0a0a0;
}
.meta.function-call {
  color: #f8f8f0;
}
.none {
  color: #a0a0a0;
}
.punctuation.definition.comment {
  color: #666666;
}
.punctuation.definition.string {
  color: #79afa9;
}
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #a0a0a0;
}
.punctuation.definition.variable {
  color: #edba00;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #79afa9;
}
.punctuation.definition.bold {
  color: #e6db74;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #aa6699;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #a71900;
}
.source.gfm .link {
  color: #79afa9;
}
.source.gfm .link.markup {
  color: #e6db74;
}
.source.gfm .heading {
  color: #cccc99;
}
.source.gfm .markup.code {
  color: #cccc99;
}
.storage {
  color: #aa6699;
}
.storage.modifier {
  color: #738c73;
}
.storage.modifier.extends,
.storage.modifier.implements {
  color: #aa6699;
}
.string {
  color: #79afa9;
}
.string.regexp {
  color: #00a8c6;
}
.string.regexp .source.ruby.embedded {
  color: #00ff00;
}
.string.other.link {
  color: #00ff00;
}
.support.class {
  color: #f8f8f0;
}
.support.function {
  color: #bfbfbf;
}
.support.function.any-method {
  color: #bfbfbf;
}
.variable {
  color: #edba00;
}
.variable.interpolation {
  color: #a71900;
}
.variable.parameter.function {
  color: #a0a0a0;
}
